Eu queria olhar ás pessoas e não enxergar o vazio que elas escondem,atrás de seus olhos bem delineados,de roupas caras e de fotos que aparentam ser felizes ,mas todas ás vezes ,só contemplo o quão infelizes todos nós somos. Seres vazios e sentimentais.
